$(document).ready(function(){


  

/*set active class to navigation item*/
  $(".header__menu_list_item").on("click", function() {
    $(".header__menu_list_item.active").removeClass("active");
    $(this).addClass("active");
  });



/*smooth scroll buttons*/
  if( $("a[href='#to-toplist']").length ){
    $("a[href='#to-toplist']").click(function() {
      $("html, body").animate({ scrollTop: ($("#toplist").offset().top - 35) }, "slow");
      return false;
    });
  } else {};


  // E-mail Ajax Send
  $("#application").ajaxForm({
      dataType: 'json',
      success: function(rv) {
        alert(rv.message)
      },
      error: function() {
        alert('   .    ');
      }
  });


// POPUP
  $(".btn__job a").magnificPopup({
    type: 'inline',

    fixedContentPos: false,
    fixedBgPos: true,

    overflowY: 'auto',

    closeBtnInside: true,
    preloader: false,
    
    midClick: true,
    removalDelay: 300,
    mainClass: 'my-mfp-slide-bottom'
  });

/*menu hamburder*/
var forEach=function(t,o,r){if("[object Object]"===Object.prototype.toString.call(t))for(var c in t)Object.prototype.hasOwnProperty.call(t,c)&&o.call(r,t[c],c,t);else for(var e=0,l=t.length;l>e;e++)o.call(r,t[e],e,t)};

    var hamburgers = document.querySelectorAll(".hamburger");
    if (hamburgers.length > 0) {
      forEach(hamburgers, function(hamburger) {
        hamburger.addEventListener("click", function() {
          this.classList.toggle("is-active");
        }, false);
      });
    }
});

var decCache = [],
    decCases = [2, 0, 1, 1, 1, 2];

function decOfNum(number, titles) {
    if (!decCache[number]) decCache[number] = number % 100 > 4 && number % 100 < 20 ? 2 : decCases[Math.min(number % 10, 5)];
    return titles[decCache[number]];
}


function timerLeft(year,month,day) {
    setInterval(function() {
      var   daysLeft = document.getElementById('timer-v-days'),
            daysText = document.getElementById('timer-v-days__text'),
            hoursLeft = document.getElementById('timer-v-hours'),
            hoursText = document.getElementById('timer-v-hours__text'),
            minutesLeft = document.getElementById('timer-v-minutes'),
            minutesText = document.getElementById('timer-v-minutes__text'),
            dateNow = new Date().getTime(),
            dateFinish = new Date(year,month,day),
            t = Math.floor(dateFinish - dateNow),
            // secToMinutes = sec % 3600,
            secondsNumber = Math.floor( (t/1000) % 60 );
            hoursNumber = Math.floor( (t/(1000*60*60)) % 24 );
            minutesNumber = Math.floor( (t/1000/60) % 60 );
            daysNumber = Math.floor( t/(1000*60*60*24) ); 

        daysText.innerHTML = decOfNum(daysNumber, ['', '', '']);
        hoursText.innerHTML = decOfNum(hoursNumber, ['', '', '']);
        minutesText.innerHTML = decOfNum(minutesNumber, ['', '', '']);
      
        daysLeft.innerHTML = daysNumber;
        hoursLeft.innerHTML = hoursNumber;
        minutesLeft.innerHTML = minutesNumber;

    },1000)
}

timerLeft(2017, 08, 31);

$(document).ready( function() {
    $(".uploadbutton input[type=file]").change(function(){
         var filename = $(this).val().replace(/.*\\/, "");
         $("#filename").val(filename);
    });
});
